// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmMenuRadio,
  VmIcon,
  VmMenuItem 
} from '@vime/core';

import { define } from '../lib';


define('vm-menu-radio', VmMenuRadio);
define('vm-icon', VmIcon);
define('vm-menu-item', VmMenuItem);


export interface MenuRadioProps extends JSX.VmMenuRadio, HTMLAttributes<HTMLVmMenuRadioElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmMenuRadioElement, MenuRadioProps>(
  'vm-menu-radio',
  new Set(['label','value','checked','badge','checkIcon','icons']),
);
